    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service, Don
    Edwards San Francisco Bay National Wildlife Refuge, and the California Department
    of Fish and Game are proposing adoption of a restoration and management plan for
    the approximately 2,600-acre Bair Island complex in order to restore Bair Island
    to tidal salt marsh. This EIS/EIR addresses the environmental impacts (effects)
    of five possible restoration and management alternatives.  The purpose and objective
    of the proposed Bair Island Restoration and Management Plan includes the following
    elements: restore high quality tidal salt marsh habitat to Inner, Middle and Outer
    Bair Islands in San Francisco Bay; maximize the function and values of tidal salt
    marsh habitats in a timely manner; provide habitat for endangered species and other
    native wildlife; and enhance the publicu2019s appreciation and awareness of the
    unique resources of Bair Island.",nt"license_title": "License Not Specified",nt"extras":
